<!DOCTYPE html>
<html>
	<head>
		<meta charset="utf-8">
		<title>\[]{}</title>
		<meta name="description" content="olla.github.io">
		<meta name="viewport" content="width=device-width,initial-scale=1,maximum-scale=1,user-scalable=yes">
		<link rel="shortcut icon" type="image/x-icon" href="favicon.ico">
		<link rel="stylesheet" type="text/css" href="index.css">
	</head>
	<body>
		<div class="containing-centre">
			<div class="centered-children">
				<pre><form><h1><label for="file" id="math">\[]{}</label><input autocomplete="off" type="file" id="file"></h1></form></pre>
			</div>
		</div>
		<div class="containing-centre">
			<div class="centered-children">
				<pre><form><h1><label for="Id1"><input autocomplete="off" title="\w{2,2}" pattern="\w{0,2}" class="unselectable" spellcheck="false" type="search" id="Id1" name="eM" list="eM" maxlength="2"><datalist id="eM"><option value="VV"><option value="VB"><option value="TB"><option value="TV"></datalist></label><label for="Id2"><input autocomplete="off" title="\w{0,7}" pattern="\w{3,7}" class="unselectable" spellcheck="false" type="search" id="Id2" name="sB" list="sB" maxlength="7"><datalist id="sB"><option value="longa"><option value="simplex"><option value="duplex"><option value="mix"><option value=""></datalist></label><label for="Id3"><input autocomplete="off" title="(\{([A-Z]+\+?){1}(\/[A-Z]+\+?)*:{1}(\\\w+:)*(\w{1}\s*\w*)+\})+" pattern="(\{([A-Z]+\+?){1}(\/[A-Z]+\+?)*:{1}(\\\w+:)*(\w{1}\s*\w*)+\})+" class="unselectable" spellcheck="false" type="search" id="Id3" name="cB" list="cB"><datalist id="sB"><option value="longa"><option value="simplex"><option value="duplex"><option value="mix"><option value=""></datalist></label></h1></form></pre>
			</div>
		</div>
		<div class="containing-centre">
		<div class="centered-children" id="lists">
		<div id="list1"></div>
		<div id="list2"></div>
		<div id="list3"></div>
		</div>
		</div>
		<script src="index.js" async></script>
	</body>
</html>
